import React from 'react';

const ComingSoon = () => {
return (
	<div>
	    <table>
	        <tr>
	            <td><img src="/Images/Coming80ForBrady.jpg" /></td>
	            <td><img src="/Images/ComingBigGeorgeForeman.jpg" /></td>
	            <td><img src="/Images/ComingBookClub.jpg" /></td>
	            <td><img src="/Images/ComingPoliteSociety.jpg" /></td>
	        </tr>
	        <tr>
	            <td>MOVIE 1 DESCRIPTION</td>
	            <td>MOVIE 2 DESCRIPTION</td>
	        	<td>MOVIE 3 DESCRIPTION</td>
	        	<td>MOVIE 4 DESCRIPTION</td>
	        </tr>
	    </table>
	</div>
);
};

export default ComingSoon;
